import Link from 'next/link';
import { motion } from 'framer-motion';

import styles from './navbar.module.scss';

export default function Navbar({ home }: { home: boolean }) {

  const nav_list = {
    initial: {
      opacity: 0,
      transition: {
        when: "beforeChildren",
        staggerChildren: 0.3,
      },
    },
    animate: {
      opacity: 1,
      transition: {
        when: "afterChildren",
      },
    },
  }
  const nav_item = {
    initial: {
      opacity: 0, x: -100
    },
    animate: {
      opacity: 1, x: 0
    }
  }

  return (
    <nav>
      <motion.ul
        className={styles.menu}
        initial="initial"
        animate="animate"
        variants={nav_list}
        transition={{duration: 2}}
      >
        <motion.li className={styles.menu_title} variants={nav_item}>
          <Link href="/">
          <a>
              Dads Blog
          </a>
          </Link>
        </motion.li>
        <motion.li variants={nav_item}><Link href="/">About</Link></motion.li>
        <motion.li variants={nav_item}><Link href="/"><a>Blog</a></Link></motion.li>
        <motion.li variants={nav_item} className={styles.dropdown}>
          <Link href="/"><a>Channels</a></Link>
          <ul className={styles.submenu}>
            <li><Link href="/"><a>One</a></Link></li>
            <li><Link href="/"><a>Two</a></Link></li>
            <li><Link href="/"><a>Three</a></Link></li>
          </ul>
        </motion.li>
      </motion.ul>
    </nav>
  );
}
